import React from 'react';
import { Carousel } from 'react-carousel3';
import '../components/FrontPageStyle.css';
export default function FrontPage() {
  const Images = [];
  return (
    <div className='container'>
      <div className='imgCarousalBox'>
        <Carousel
          height={460}
          width={980}
          yOrigin={42}
          yRadius={48}
          autoPlay={true}>
          {Images.map((image, index) => (
            <div key={index}>
              <img src={image} width='300' height='200' />
            </div>
          ))}
        </Carousel>
      </div>
      <div className='data'>
        <p> Please join us at the </p>
        <h2>Blessing</h2>
        <h3>of our Son</h3>
        <h2>Greetik</h2>
        <p>(Son of Anchal and gajendra singh deval) </p>
        <h4>Functionsâ™¡</h4>
        <div className='functions'>
          <h3>Katha - 9 am</h3>
          <h3>Jalwa poojan - 4 pm</h3>
          <h3>Dinner - 6 pm onwards</h3>
        </div>
        <h2>Monday, november 21 2022</h2>{' '}
        <p>
          Venue
          <h3>mangalam c-181, kirti nagar, magra poonjla, jodhpur</h3>
        </p>
      </div>
    </div>
  );
}
